[[package]]
category = "main"
description = "A pluggable API specification generator. Currently supports the OpenAPI Specification (f.k.a. the Swagger specification)."
marker = "python_version >= \"3.6\""
name = "apispec"
optional = false
python-versions = "*"
version = "1.3.3"

[package.dependencies]
